import React from "react";

const Footer = () => {
  return (
    <div className="footer">
      <p>
        Copyright {new Date().getFullYear()} IMPACT SOFTWARE SYSTEMS (1996) LTD
        | All Rights Reserved
      </p>
    </div>
  );
};

export default Footer;
